import "./App.css";
import Chart from "./Chart";
import { lineChartOptions } from "./options";
import { exportMultipleChartsToPdf } from "./utils";
import CrimeData from "./CrimeData";

function App() {
  return (
    <div className="App">
      <button className="button" onClick={exportMultipleChartsToPdf}>
        Export to PDF
      </button>
      <Chart chartOptions={lineChartOptions} >
        <CrimeData/>
      </Chart>
    </div>
  );
}

export default App;
